%[text] ## Problem 3 (10 points) Application of Least Squares to Data Fitting
%[text] The dataset $\\texttt{carbig}$, a built\-in MATLAB dataset, contains various characteristics for $m=406$ automobiles from the 1970s and 1980s. Let $x\_1, \\, x\_2$ and $y$ be the $\\texttt{Weight}$, $\\texttt{Horsepower}$ and $\\texttt{MPG (Miles Per Gallon)}$ respectively. Let us assume the following theoretical model for the data:
%[text]{"align":"center"} $y = f(x\_1, x\_2) = \\beta\_0\+\\beta\_1x\_1\+\\beta\_2x\_2\+\\beta\_3x\_1x\_2\\,\\,\\,\\,\\,(\\star)$
%[text] Let $\\beta^\* = \\left(\\beta\_0^\*, \\beta\_1^\*, \\beta\_2^\*, \\beta\_3^\*\\right)^T$ denote the best fit to the data, i.e. the vector that minimizes the Euclidean norm of the residual vector $r = \\left(r\_1,\\cdots,r\_m\\right)^T$, where:
%[text]{"align":"center"} $r\_i = y^{(i)}\-f\\left(x\_1^{(i)}, x\_2^{(i)}\\right)$
%[text] ## Part (a) (5 points)
%[text] Derive the system of normal equations on $\\beta^\*$. Do this in your written\-up solutions.
%[text] ## Part (b) (5 points)
%[text] Find $\\beta^\*$ by solving the normal system numerically and plot the scatter plot of the data $\\left\\{\\left(x\_1^{(i)}, x\_2^{(i)}, y^{(i)}\\right)\\right\\}, i = 1\\cdots m$, together with the fitted surface $y=f\\left(x\_1, x\_2\\right)$ given by $(\\star)$.
%[text] To start, let us load the dataset, define our variables, and perform some necessary cleanup as there exist $\\texttt{NaN}$ values. We do this for you :)
load carbig;
x1=Weight;
x2=Horsepower;
y=MPG;
clearvars -except x1 x2 y;
% Data cleaning
y=y(x1>0);
x2=x2(x1>0);
x1=x1(x1>0);

y=y(x2>0);
x1=x1(x2>0);
x2=x2(x2>0);

x1=x1(y>0);
x2=x2(y>0);
y=y(y>0);
%[text] Now, the dataset is ready for you to solve the normal system. Let us vizualize it. Drag the 3D plot around to get a better sense of the data.
figure; %[output:768d7eb1]
scatter3(x1,x2,y,'MarkerEdgeColor','k','MarkerFaceColor','c'); %[output:768d7eb1]
xlabel('Weight'); %[output:768d7eb1]
ylabel('Horsepower'); %[output:768d7eb1]
zlabel('MPG'); %[output:768d7eb1]
title('Raw Data'); %[output:768d7eb1]
%[text] Finally, let us find the best surface to fit the data. Remember, in MATLAB, when solving a system, backslash is your best friend. Use $\\texttt{scatter3()}$ and $\\texttt{fsurf()}$ when plotting.
