%[text] ## Problem 4 (10 points) Polynomial Interpolation
%[text] Interpolating polynomials $p(x)$ are used for approximation of complex functions $g(x)$. Intuitively, the larger the degree of the interpolating polynomial, the more accurate the approximation $g(x)\\approx p(x),x\\in [a,b]$. Generally, this is not true (as you will see in this problem). High degree interpolating polynomials often behave badly, especially near the ends of the interval $[a,b]$. In practice, piecewise cubic splines are often used instead of high degree polynomials.
%[text] Suppose we want to approximate the function:
%[text]{"align":"center"} $g(x) = \\frac{\\cos x}{\\cosh x},\\,\\,x\\in[\-a,a]$
%[text] using $n$ points equally spaced between $\-a$ and $a$. Find the interpolating polynomials and plot them versus the function $g(x)$ for $a = 1, 5$ and $n = 3, 5, 10, 15$. In your plot, show also the data points used for interpolation. The code should produce a single figure with 8 subplots.
%[text] Useful MATLAB functions for this problem:
%[text]{"align":"center"} $\\texttt{linspace(), fplot(), polyval(), polyfit()}$
%{
Let us start by doing some setup
%}
g = @(x) cos(x) ./ cosh(x); % you can define functions like this
a = [1, 5]; % setting interval values
n = [3, 5, 10, 15]; % setting the number of points
sub = 1; % setting the subplot index

%{
Let us see how g(x) looks like on both intervals
%}
figure; %[output:5a5354ff]
subplot(1, 2, 1); %[output:5a5354ff]
fplot(g, [-a(1), a(1)], "-c", "lineWidth", 4); %[output:5a5354ff]
title("$\frac{\cos{x}}{\cosh{x}}$ on $[-1, 1]$","Interpreter","latex"); %[output:5a5354ff]
hold on %[output:5a5354ff]
subplot(1, 2, 2); %[output:5a5354ff]
fplot(g, [-a(2), a(2)], "-c", "lineWidth", 4); %[output:5a5354ff]
title("$\frac{\cos{x}}{\cosh{x}}$ on $[-5, 5]$","Interpreter","latex"); %[output:5a5354ff]

%{
Complete the nested for-loops
%}
figure;
for ival = a
    for degree = n-1
        %{
        Select degree+1 points in the interval
        Evaluate g(x) on these points
        Find the polynomial coefficients
        %}
        
        %{ 
        PLOTTING
        Plot g(x), the sampled points and interpolating polynomial
        Please use different colors and linestyles
        %}
        
    end
end
%[text] ## Problem 5 (10 points) Stability of the Gram\-Schmidt Algorithm
%[text] The classical Gram\-Schmidt algorithm is numerically unstable. This means that, when implemented on a computer, the round\-off errors can cause the output vectors to be significantly non\-orthogonal. To explore the issue, perform the following computations for each $n = 10, 20, 30,\\cdots, 100$:
%[text] 1. Create the Hilbert matrix $H\_n$ of size $n$ (using $\\texttt{hilb(n)}$) and consider the columns $h\_1,\\cdots,h\_n$ as a basis of $\\mathbb{R}^n$. The matrix $H\_n$ is non\-singular, and thus its columns indeed form a basis, but it is very close to singular (i.e. its columns are close to being linearly dependent), and this leads to numerical problems.
%[text] 2. Implement the basic Gram\-Schmidt algorithm to construct an orthogonal basis $\\{v\_1,\\cdots,v\_n\\}$ of $\\mathbb{R}^n$ from $h\_1,\\cdots,h\_n$. Please don't use any advanced built\-in function for orthogonalization (such as $\\texttt{orthog()}$) just basic matrix operations. At the end of the process normalize your vectors so that the basis is orthonormal.
%[text] 3. If vectors $v\_1,\\cdots,v\_n$ obtained in (2) are orthonormal, then $V = [v\_1,\\cdots,v\_n]$ must be orthogonal. As a measure of orthogonality, compute the infinite norm $\\delta\_V(n) = ||I\_n\-V^TV||\_{\\infty}$, which is a matrix norm (use $\\texttt{norm(A, Inf)}$). The closer $\\delta\_V(n)$ is to zero, the closer the columns of $V$ are to being orthogonal.
%[text] 4. Repeat (2) and (3) to construct an orthonormal basis $\\{u\_1,\\cdots,u\_n\\}$ using the modified Gram\-Schmidt algorithm (which is numerically more stable) described in lecture 9 (page 46), and compute $\\delta\_U(n)$.
%[text] 5. To compare the basic and modified Gram\-Schmidt algorithms, plot $\\delta\_V(n)$ and $\\delta\_U(n)$ versus $n$. \
